import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { Route, Switch } from 'react-router-dom';
import  Professional from './Professional';
import  Varification from './Varification';


const Upload = () => {

  <Switch>
  <Route exact path="/Professional" component={Professional}/>
  <Route exact path="/Varification" component={Varification}/>
</Switch>

    return (
              <>
              <div className="upload_container">
                <h1 className="upload_h1">Upload Following Details :</h1>
           
                <div class="mb-3 my-5">
  <label for="formFile" class="form-label upload_caption">10th ScoreCard</label>
  <input class="form-control" type="file" id="formFile"/>
</div>          
                  <div class="mb-3">
  <label for="formFile" class="form-label upload_caption">12th ScoreCard</label>
  <input class="form-control" type="file" id="formFile"/>
</div>    
                   <div class="mb-3">
  <label for="formFile" class="form-label upload_caption">Collage Marksheet</label>
  <input class="form-control" type="file" id="formFile"/>
</div>
                   <div class="mb-3">
  <label for="formFile" class="form-label upload_caption">Experience Certificate</label>
  <input class="form-control" type="file" id="formFile"/>
</div>
            
                </div>
              </>

    );
}
export default Upload;
